def isSubsequence(s, t):
	"""
	:type s: str
	:type t: str
	:rtype: bool
	"""
	## O(mn)
	# if not s:return True
	# if not t:return False
	# m = len(s)
	# n = len(t)
	# dp = [[0 for _ in range(n+1)] for _ in range(m+1)]
	# for i in range(1,m+1):
	# 	for j in range(1,n+1):
	# 		if s[i-1] == t[j-1]:
	# 			dp[i][j] = dp[i-1][j-1]+ 1
	# 		else:
	# 			dp[i][j] = max(dp[i-1][j], dp[i][j-1])

	# return dp[m][n] == m

	# O(m+n)
	if not s:return True
	if not t:return False
	m = len(s)
	n = len(t)
	idx1 = 0
	idx2 = 0
	match = 0
	while idx1 < m and idx2 < n:
		if s[idx1] == t[idx2]:
			match += 1
			idx1 += 1
			idx2 += 1
		else:
			idx2 += 1
	return match == m





